sources.styles/components/_hero.scss:
.hero {
  position: relative;
  z-index: 0;
  background-image: url('/img/pics/kalalau.png');
  background-repeat: no-repeat;
  background-size: 100% 100%;
  background-position: center center;
  display: flex;
  flex-flow: column;
  justify-content: center;
  align-items: center;
  height: 100vh;

  &:before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    z-index: 1;
    width: 100%;
    height: 100%;
    background-color: $black;
    opacity: 0.2;
  }
  &:after {
    content: '';
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    position: absolute;
    background: linear-gradient(to top, rgba(0, 0, 0, 1) 0%, rgba(0, 0, 0, 0) 20%);
    z-index: 2;
  }
}

// WELCOME TEXT
.welcome-text {
  position: relative;
  z-index: 3;
}

// SCROLL
.scroll-svg__container {
  height: 57px;
  width: 27px;
  display: flex;
  justify-content: center;
  position: relative;
  z-index: 3;
  .scroll-btn {
    // animation: scrollSvgAnimation 1s infinite alternate-reverse;
  }
}

@keyframes scrollSvgAnimation {
  from {
    transform: translate(923px, 890px);
    z-index: 5;
  }
  to {
    transform: translate(923px, 916px);
  }
}

// SCROLL ICON
.scroll__container {
  display: flex;
  justify-content: center;
  svg {
    width: 20px;
    height: 40px;

    .scroll-button {
      animation: scrollSvgAnimation 1s infinite alternate-reverse;
    }
  }
}

@keyframes scrollSvgAnimation {
  from {
    transform: translate(176px, 303px);
    z-index: 5;
  }
  to {
    transform: translate(176px, 314px);
  }
}
